                  type="text"
                />
                <div className="search-icon">
                  <img src={searchIcon} alt="search-icon" />
                </div>
              </div>
            </div>
            <div
              className="create-btn"
              onClick={() => navigate("/Manager/CreateBreeder")}
            >
              New Breeder
              <i className="fa-solid fa-plus"></i>
            </div>
          </div> */}
          <table className="table-manage-breeder">
            <thead>
              <tr>
                <th>No</th>
                <th>Fish Entry ID</th>
                <th>Auction ID</th>
                <th>Auction Date</th>
                <th>Sold Price</th>
                {/* <th>Phone</th>
