                      <td>{breeder.firstName}</td>
                      <td>{breeder.lastName}</td>
                      <td>{breeder.email}</td>
                      <td>{breeder.phone}</td>
                      <td>{breeder.status}</td>
                      <td>
                        <i
                          className="fa-solid fa-arrow-right"
                          onClick={() =>
                            navigate(
                              `/Manager/BreederDetail?id=${breeder.userId}`
                            )
                          }
                        ></i>
                      </td>
                    </tr>
                  );
                })
